let vm=new Vue({vuetify:vuetify,el:"#app-container",data:{notifications:[],tab:null,nav_tab:null,course_id:null,course_status:null,course_status_loading:!1},computed:{},watch:{dialogUserRemove(s){s||this.closeDelete()},sponsorViewsStatistics(s){this.getSponsorViewsStatistics()}},created(){check_google_user()},mounted(){this.course_id=this.$refs.course_container.getAttribute("course_id"),this.$refs.hasOwnProperty("alert_course_status")&&(this.course_status=this.$refs.alert_course_status.getAttribute("initial-status"))},methods:{updateCourseStatus(s){var t=this;t.course_status_loading=!0;var e=api_url+"courses/update-status/"+t.course_id;t.$http.post(e,{course_status:s}).then(e=>{t.course_status_loading=!1,"success"==e.body.status&&(t.course_status=s)},s=>{t.course_status_loading=!1})},getCourseStatusColor(){switch(this.course_status){case"2":return"warning";case"1":return"success";case"0":return"error"}}}});